import axios from 'axios';

const ALUMNO_API_URL = "http://localhost:8002/alumno/";

class AlumnoService {

    getAlumnos(){
        return axios.get(ALUMNO_API_URL);
    }

    createAlumno(){
        return axios.post(ALUMNO_API_URL);
    }

    getAlumoByRut(rut){
        return axios.get(ALUMNO_API_URL + rut);
    }
}

export default new AlumnoService()
